choices.text:
Object object = getObject( i );
if( object instanceof COSNumber )
{
    COSNumber cosNumber = (COSNumber)object;
    retval[i] = cosNumber.floatValue();
}

COSBase base = getObject( i );
if( base instanceof COSNumber )
{
    retval[i] = ((COSNumber)base).floatValue();
}
else
{
    throw new RuntimeException( "Cannot convert to float array, value is not a COSNumber, its a " + base.getClass().getName() );
}

COSBase cosBase = getObject( i );
if( cosBase instanceof COSNumber )
{
    COSNumber cosNumber = (COSNumber)cosBase;
    retval[i] = cosNumber.floatValue();
}
else if( cosBase instanceof COSBoolean )
{
    COSBoolean cosBoolean = (COSBoolean)cosBase;
    retval[i] = cosBoolean.getValue() ? 1f : 0f;
}
else
{
    //should be a null object
    retval[i] = Float.NaN;
}

